query:
mutation licensingUpdateCommercialLicense ( $accountId:ID! $updateCommercialLicenseInput:UpdateCommercialLicenseInput!) {
	licensing ( accountId:$accountId ) {
		updateCommercialLicense ( input:$updateCommercialLicenseInput  )  {
			license {
				id
				description
				plan
				sku
				status
				startDate
				expirationDate
				lastUpdated
				... on DataLakeLicense {
					dpaVersion
					retentionPeriod
					total
				}
				... on PublicIpsLicense {
					total
				}
				... on SiteLicense {
					siteLicenseGroup
					regionality
					siteLicenseType
					total
					site {
						id
						name
					}
				}
				... on PooledBandwidthLicense {
					siteLicenseGroup
					siteLicenseType
					total
					allocatedBandwidth
					sites {
						sitePooledBandwidthLicenseSite: site {
							id
							name
						}
						allocatedBandwidth
					}
					accounts {
						accountPartnerPooledBandwidthLicenseAccount: account {
							id
							name
						}
						allocatedBandwidth
					}
				}
				... on ZtnaUsersLicense {
					ztnaUsersLicenseGroup
					total
				}
				... on EndpointProtectionLicense {
					total
				}
				... on IlmmLicense {
					total
				}
				... on SaasSecurityApiLicense {
					total
				}
				... on XdrProLicense {
					total
				}
				... on DemLicense {
					total
				}
			}
		}
	}	
}
